import React, { Component } from "react";
import Slider from "react-slick";
import "slick-carousel/slick/slick.css";
import "slick-carousel/slick/slick-theme.css";

export default class SimpleSlider extends Component {
  render() {
    const settings = {
      dots: true,
      infinite: true,
      speed: 500,
      slidesToShow: 1,
      slidesToScroll: 1
    };
    return (
      <div>
        <h2> Single Item</h2>
        <Slider {...settings}>
          <div>
            <img src="https://cdn.pixabay.com/photo/2016/11/11/07/51/moon-1815984__340.jpg" className="w-100" alt="slider1" />
          </div>
          <div>
            <img src="https://cdn.pixabay.com/photo/2017/02/05/19/23/eye-2040986_960_720.jpg" className="w-100" alt="slider2" />
          </div>
          <div>
            <img src="https://cdn.pixabay.com/photo/2017/02/10/18/47/love-2055960__340.jpg" className="w-100" alt="slider3" />
          </div>
          <div>
            <h3>4</h3>
          </div>
          <div>
            <h3>5</h3>
          </div>
          <div>
            <h3>6</h3>
          </div>
        </Slider>
      </div>
    );
  }
}
